How to call data ref to the user?<p>I'm having a lot of trouble, How can I render all products that is Referenced to the <strong>user</strong>? What I'm trying to do is, make the user owner of the product, so when I fetch all the table, I will only receive the products created by the user/owner</p>
<p><a href="https://i.stack.imgur.com/ymP70.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/ymP70.png" alt="enter image description here" /></a></p>
<p>This is how I call, and I don't know what function should I use,</p>
<pre><code> router.get('/customerproduct',  async (req,res) =&gt;{
    try {
      const posts = await Product.find()
                    .populate(&quot;user_id&quot;)
      res.status(200).json(posts)

    } catch (error) {
      res.status(404).json({message: error.message})  
    }
})
</code></pre>
<p>Schema</p>
<pre><code>const ProductSchema = mongoose.Schema({

    user_id: {type: mongoose.Schema.Types.ObjectId, required: true, ref: 'User'},
