How to create or update within object of objects<p>I'm trying to access a database with the following difficult schema and want to update the <code>file_name</code> value if it exists, or create a new object with the <code>file_name</code> if it does not. As I have searched, the option <code>{ upsert: true, new: true, setDefaultsOnInsert: true };</code> will update do the second bit, but the problem is how do you access the file_name key nested deep within.</p>
<pre class="lang-js prettyprint-override"><code>export type _ID = string;
export interface FileSchema {
    [_id: _ID]: {
        file_name: string;
        creation_date: Date;
        isPublished: boolean;
        content: string;
    };
}
export interface AccountSchema {
  ...
    files: FileSchema;
}
const accountSchema = new Schema&lt;AccountSchema&gt;({
  ...
    files: {
        type: Map,
        unique: true,
        of: {
            file_name: {
                type: String,
                required: true,
                minlength: 4,
                maxlength: 60,
                unique: true,
            },
            creation_date: {
                type: Date,
                required: true,
            },
            isPublished: {
                type: Boolean,
                required: true,
            },
            content: {
                type: String,
                required: true,
            },
        },
    },
});
</code></pre>

