My Query Quagmire: My node.js program works just fine, except when I try to execute queries, or filtered HTTP requests. Why?<p>I have been working on the backend of my app. At this point, it can access all data in a data base, and output it. I'm trying to implement some queries, so that the user can filter out the content that is returned. My DAL/DAO, looks like this</p>
<pre><code>let mflix   //Creates a variable used to store a ref to our DB

class MflixDAO {
    static async injectDB(conn){    
        if(mflix){
            return
        }

        try{
            mflix = await conn.db(process.env.JD_NS).collection(&quot;movies&quot;)
        }catch(e){
            console.error('Unable to establish a collection handle in mflixDAO: ' + e)
        }
    }

    // Creates a query to fetch data from the collection/table in the DB
    static async getMovies({

        mflix.controller
        filters = null,
        page = 0,
        moviesPerPage = 20,
    } = {}) {
        let query

        if (filters){
            // Code
            if(&quot;year&quot; in filters){
                query = {&quot;year&quot;: {$eq: filters[&quot;year&quot;]}}
            }
            // Code
        }

        // Cursor represents the returned data
        let cursor

        try{
            cursor = await mflix.find(query)
        }catch(e){
            console.error('Unable to issue find command ' + e)
            return {moviesList: [], totalNumMovies: 0}
        }

        const displayCursor = cursor.limit(moviesPerPage).skip(moviesPerPage * page)

        try{
            const moviesList = await displayCursor.toArray()    // Puts data in an array
            const totalNumMovies = await mflix.countDocuments(query)  // Gets total number of documents

            return { moviesList, totalNumMovies}
        } catch(e){
            console.error('Unable to convert cursor to array or problem counting documents ' + e)
            return{moviesList: [], totalNumMovies: 0}
        }

    }
}

export default MflixDAO
</code></pre>
<p>Just so you know, I am using a sample database from MongoDB Atlas. I am using Postman to test HTTP requests. All the data follows JSON format</p>
<p>Anyway, when I execute a basic GET request. The program runs without any problems. All the data outputs as expected. However, if I execute something along the lines of</p>
