<p>On my first API, I simply had a ConfigClass that was exported, with Nest, I have a service that is called in my controllers.</p>
<p>What I'm trying to do is to create a mongoose virtual field depending on the value of the configuration.
Since my configuration is now stored in a service, I doubt, that I could just import it and use it as-is.</p>
<p>Code-wise, my current configuration module and service look like :</p>
<pre><code>    //app-config.config.ts

    import { registerAs } from '@nestjs/config';

    export const AppConfiguration = registerAs('app', () =&gt; ({
      name: process.env.APP_NAME.trim(),
      host: process.env.APP_HOST.trim(),
    }));

    //app-config.service.ts

    import { Injectable } from '@nestjs/common';
    import { ConfigService } from '@nestjs/config';

    @Injectable()
    export class AppConfigService {
      constructor(private _config: ConfigService) {}

      get name(): string {
        return this._config.get&lt;string&gt;('app.name');
      }

      get host(): number {
        return this._config.get&lt;number&gt;('app.host');
      }
    }

    //app-config.module.ts

    import { Module } from '@nestjs/common';
    import { ConfigModule, ConfigService } from '@nestjs/config';
    import * as Joi from 'joi';

    import { AppConfiguration } from './app-config.config';
    import { AppConfigService } from './app-config.service';

    @Module({
      imports: [
        ConfigModule.forRoot({
          load: [AppConfiguration],
          validationSchema: Joi.object({
            APP_NAME: Joi.string().default('nest api'),
            APP_HOST: Joi.string().default('localhost.lan'),
          }),
        }),
      ],
      providers: [ConfigService, AppConfigService],
      exports: [AppConfigService],
    })
    export class AppConfigModule {}
</code></pre>
<p>My schema would look like :</p>
<pre><code>import { Prop, Schema, SchemaFactory } from '@nestjs/mongoose';

    @Schema({
      toObject: {
        virtuals: true,
