<p>So far, I thought about setting up nodejs globals in the AppConfigModule constructor, I even thought about sending the needed config property to the client, and letting the client do the concatenation.</p>
<p>I'm looking for what would be the cleanest way to do this, I may be unaware of a built-in method.</p>
<p>Thanks in advance. I'll keep this updated if I find an acceptable solution to my problem.</p>

